INSERT INTO `questions` VALUES (5,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify;\"><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\"><img src=\"../../../uploads/nB6DLWgwnmt807gNZSBsWVkP1iOi9hIiAQmsmhwq.jpeg\" alt=\"\" width=\"990\" height=\"654\" />Какую военную операцию немецко-фашистское командование называло операцией &laquo;Тайфун&raquo;, которая походила с 30 сентября по 4 декабря 1941 года?</span></p>\r\n<p>&nbsp;</p>',1,10,1),(7,'<p style=\"margin-bottom: .0001pt;\"><span style=\"font-size: 14.0pt;\">Город-герой, который за свою великую историю, которая началась в 863 году, отважно защищался во все времена, в том числе в смутное время, от войск Наполеона и в 1941 году от немецких захватчиков?</span></p>',1,10,1),(9,'<p><span style=\"font-family: Calibri, sans-serif; font-size: 18.6667px;\">14 июля 1941 года</span><span style=\"font-family: Calibri, sans-serif; font-size: 18.6667px;\">&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 14pt;\">войска Красной Армии в</span><span style=\"font-family: Calibri, sans-serif; font-size: 18.6667px;\">первые </span><span style=\"font-family: Calibri, sans-serif; font-size: 14pt;\">применили систему полевой реактивной артиллерии, позже прозванной&nbsp; - &hellip;&hellip;&hellip;&hellip;?</span><img style=\"font-family: Calibri, sans-serif; font-size: 14pt;\" src=\"../../uploads/5AlINjwemV7zZyBB7wDIqCdbdNtCPVAMGMCPahVP.jpeg\" alt=\"\" width=\"675\" height=\"380\" /></p>',1,10,1),(10,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify;\"><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">Первый военный парад на Красной площади Москвы,</span><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: RU;\"> который принимал маршал С.М.Будённый, начался в 8 часов утра и шёл всего лишь около получаса. <span style=\"mso-spacerun: yes;\">&nbsp;</span></span><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">О времени проведения парада командиры частей узнали за 8-9 часов. Информация населению была доведена намного позднее. До последнего времени в секрете держалось и место проведения парада. У всех участвовавших в параде, даже у тех, кто позже отправлялся на фронт, были изъяты патроны, также были изъяты все снаряды из танков и артиллерийских орудий.</span> <span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">Когда прошёл этот парад?</span></p>\r\n<p><img src=\"../../uploads/tzAJD9HJhoz3kjx8ktUcDGj5HDjdBTBy2yOzbahs.jpeg\" alt=\"\" width=\"700\" height=\"306\" /></p>',1,10,1),(11,'<p><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: RU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Стихи этой песни, ставшие главной песней Великой Отечественной войны, были напечатаны на третий день войны - 24 июня 1941 года. О какой песне идет речь?&nbsp;</span></p>',1,10,1),(12,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: RU;\">Какой&nbsp; город в 1941 году временно стал второй столицей нашей страны, куда эвакуировали <span style=\"mso-spacerun: yes;\">&nbsp;</span>правительство СССР</span> <span class=\"sg-text\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span><span class=\"sg-text\"><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\';\">и дипломатические представительства</span></span><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: RU;\">? </span></p>',1,10,1),(13,'<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-weight: bold;\">Как называлась крепость, которая одной из первых приняла на себя удар фашистских войск и оборонялась с 22 июня </span><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">1941 года &ndash; 30 дней<span style=\"mso-bidi-font-weight: bold;\">?</span></span><img style=\"font-family: \'Times New Roman\', serif; font-size: 18.6667px;\" src=\"../../../uploads/xwZcydC5wBVQaAQSBAVaiOHapBazL1bVN4Ttk0c5.jpeg\" alt=\"\" width=\"833\" height=\"556\" /></p>',1,10,1),(14,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify;\"><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">Кто является автором известного стихотворения &laquo;Жди меня&raquo;, написанного в июле-августе 1941 года?&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center;\" align=\"center\"><span style=\"font-size: 14.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">Жди меня, и я вернусь, всем смертям назло. Кто не ждал меня, тот пусть скажет: \"Повезло\". Не понять не ждавшим им, как среди огня, ожиданием своим ты спасла меня&hellip;&hellip;</span></p>',1,10,1),(15,'<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify;\"><strong><span style=\"font-size: 14.0pt; font-weight: normal; mso-bidi-font-weight: bold;\">Во время Великой Отечественной войны в состав наших войск входила 28‑я резервная армия, в которой тягловой силой для пушек были эти необычные животные.</span></strong> <span style=\"font-size: 14.0pt;\">Армия была сформирована в Астрахани во время боёв под Сталинградом: нехватка машин и лошадей вынудила отловить в окрестностях этих животных<span style=\"mso-spacerun: yes;\">&nbsp; </span>и приручить их. Каким животным</span><span style=\"font-size: 14.0pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>установлен памятник на центральной площади <span class=\"extended-textshort\">в г. Ахтубинск, Астраханской области?</span></span></p>\r\n<p><img src=\"../../../uploads/PYvYt1wlraOynghDXf2m796QCNNdCf3P4dnMsXd2.jpeg\" alt=\"\" width=\"400\" height=\"300\" /></p>',1,10,1),(16,'<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify;\"><strong><span style=\"font-size: 14.0pt; font-weight: normal; mso-bidi-font-weight: bold;\">В начале войны СССР испытывало большую нехватку танков, в связи с этим было принято решение в экстренных случаях переоборудовать ......................&nbsp; &nbsp; в танки, обшивая их листами брони. </span></strong><span style=\"font-size: 14.0pt;\">Основная ставка была сделана на психологический эффект: атака производилась в ночь с включенными фарами и сиренами.<span style=\"mso-spacerun: yes;\">&nbsp; </span>За подобные случаи, а также за то, что на эти машины часто устанавливались муляжи тяжёлых орудий, солдаты прозвали их НИ-1, что расшифровывается - &laquo;На испуг&raquo;.</span></p>',1,10,1),(17,'<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt;\">Осенью 1941 </span><span style=\"font-size: 14.0pt;\">года в&nbsp; СССР </span><span style=\"font-size: 14.0pt;\">было начато формирование авиационных частей, укомплектованных женщинами. Один из женских авиаполков </span><span style=\"font-size: 14.0pt;\">имел на вооружении самолёты У-2. 23 лётчицы, воевавшие на У-2, удостоены звания Героев Советского Союза</span><span style=\"font-size: 14.0pt;\">. А под каким обиходным названием эти самолеты известны нам? </span></p>',1,10,1),(18,'<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\">Первая награда, которая появилась в годы Великой Отечественной войны для награждения солдат и начальствующего состава&nbsp; Красной Армии, Военно &ndash; морского флота, войск НКВД и партизанских отрядов, проявившие в боях за Советскую Родину храбрость, стойкость и мужество. Состоит из двух степеней: I и II степени. Высшей степенью ордена является I степень. Назовите эту награду.</span></p>\r\n<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\"><img style=\"font-family: \'Times New Roman\', serif;\" src=\"../../uploads/t7e9zipaW6LQKos4UvG4Js0jV3ev86DwY1rOip9s.jpeg\" alt=\"\" width=\"348\" height=\"223\" /></span></p>\r\n<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\"><img src=\"../../uploads/772vS0JA84dgnhwiQ0OOh96DQmJ7Y56gh1o2Vvt6.jpeg\" alt=\"\" width=\"360\" height=\"237\" /></span></p>\r\n<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\"><img src=\"../../uploads/w1WXlbD6TD8wnqe04uMlADeG3xnkvLSBmI1ck5E2.jpeg\" alt=\"\" width=\"230\" height=\"221\" />&nbsp;<img src=\"../../uploads/1v3uf2CVLkqVZjrXiCOAuo61TGYIHyRwCMOZe3lW.jpeg\" alt=\"\" width=\"219\" height=\"226\" /></span></p>\r\n<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\">&nbsp;</p>',1,10,2),(19,'<p class=\"MsoListParagraph\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&laquo;Дорога жизни&raquo; проходила по льду</span></strong><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> под постоянными обстрелами немцев. Назовите город, который смог выстоять, благодаря этому пути?</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><img style=\"font-family: \'Times New Roman\', serif; font-size: 18.6667px;\" src=\"../../uploads/uUYGt324ubNDE4t1rnTXh1Y0ULkhu15T9IfJl9hK.jpeg\" alt=\"\" width=\"581\" height=\"436\" /></p>\r\n<p>&nbsp;</p>',1,10,2),(20,'<p class=\"MsoListParagraph\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">28 июля 1942 года Сталин издал знаменитый Приказ № 227. Он требовал восстановить железную дисциплину среди солдат и офицеров, вводил в тылу неустойчивых подразделений специальные заградительные отряды. Отметьте его название.</span></p>',1,10,2),(21,'<p class=\"MsoListParagraph\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Сколько дней продолжалась блокада Ленинграда?</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><img style=\"font-family: \'Times New Roman\', serif;\" src=\"../../../uploads/7ejKgeQ9Ake1oaESZdTuCEmYtYEzpUFYubJfRAoM.jpeg\" alt=\"\" width=\"579\" height=\"421\" /></span></p>\r\n<p>&nbsp;</p>',1,10,2),(22,'<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><img src=\"../../uploads/F8FMsbKJpabAqXXiLb4EnPMDtE4GJ1qHk97jOyZR.jpeg\" alt=\"\" width=\"536\" height=\"404\" /></span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Про котёнка Василия с улицы Лизюкова знают все, а в честь кого названа эта известная улица города Воронежа?</span></p>',1,10,2),(23,'<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">По какому озеру проходила <strong style=\"mso-bidi-font-weight: normal;\">&laquo;дорога жизни&raquo;?</strong> </span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><strong style=\"mso-bidi-font-weight: normal;\"><img src=\"../../../uploads/K4hiQPUNEU2nERhykuhgot5UIFkunTGK70wa7s24.jpeg\" alt=\"\" width=\"557\" height=\"418\" /></strong></span></p>\r\n<p>&nbsp;</p>',1,10,2),(24,'<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Фашистские войска в 1941-1942 годах потратили на захват этого города 250 дней, а советские войска в 1944 году освободили его за 5 дней. Что это за город?</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify;\"><img style=\"font-family: \'Times New Roman\', serif; font-size: 18.6667px;\" src=\"../../uploads/QjywJwsgtnoN3PAuEajca4LqUQz8Hgdzkh1aYKcg.jpeg\" alt=\"\" width=\"819\" height=\"502\" /></p>',1,10,2),(25,'<p><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: RU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Город, основанный как крепость для защиты Санкт-Петербурга с моря.</span></p>\r\n<p><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: RU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><img src=\"../../uploads/wv7ywsN190FdX15pPWWD3OVGNvwlIvk3P1a5Uv9O.jpeg\" alt=\"\" width=\"591\" height=\"439\" /></span></p>',1,10,2),(26,'<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Какое кодовое название носит операция, которая проходила с 30 декабря 1942 года по 2 февраля 1943 года, в результате которой армия Паулюса была разделена и капитулировала?</span></p>\r\n<p><img src=\"../../uploads/QUHncOhav1vAu2Xb5Tt8dWFLEDlIDip1brQSrYwa.jpeg\" alt=\"\" width=\"589\" height=\"488\" /></p>',1,10,2),(27,'<p><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: RU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">После какой битвы был <strong>развеян миф</strong> о непобедимости гитлеровской армии?</span></p>\r\n<p><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: RU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><img src=\"../../uploads/txLhjNW0QhI0tEkvEPY9q3xRTCM98QtJLFSnJkol.jpeg\" alt=\"\" width=\"610\" height=\"403\" /></span></p>',1,10,2),(28,'<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">27 января 1942 года в &laquo;Правде&raquo; опубликован очерк фронтового корреспондента Петра Лидова &laquo;Таня&raquo; о подвиге казненной девушки с упомянутым псевдонимом.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Кто эта первая женщина, Герой Советского Союза, юная партизанка и разведчица?</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><img style=\"font-family: \'Times New Roman\', serif;\" src=\"../../../uploads/tfJuGsoxc4azDgVCL2I47UB7i9JZYfo6ifxjgqru.jpeg\" alt=\"\" width=\"355\" height=\"555\" /></span></p>',1,10,2),(29,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14.0pt;\">Перед этой битвой немецкое командование сосредоточило значительные силы, состоящие, прежде всего, из бронетанковых дивизий, оснащенных танками современных моделей &ldquo;Тигр&rdquo; и &ldquo;Пантера&rdquo;. Что это за битва?</span></p>',1,10,3),(30,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Как называлась крупнейшая партизанская операция, проходившая во время Курской битвы?</span></p>',1,10,3),(31,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Кто из этих генералов Советской Армии командовал войсками под Прохоровкой?&nbsp;</span></p>\r\n<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><img src=\"../../../uploads/BOKQbLcQDkPW2BVTG62ojvH0hsZhgBcPPws66n9C.jpeg\" alt=\"\" width=\"604\" height=\"408\" /></span></p>',1,10,3),(32,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Назовите остров, который известен&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 18.6667px;\">из истории Сталинградской битвы, но </span><span style=\"font-family: \'Times New Roman\', serif; font-size: 14pt;\">которого нет ни на одной географической карте?&nbsp;</span></p>',1,10,3),(33,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Как называлась немецкая наступательная операция в ходе Курской битвы?</span></p>\r\n<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><img src=\"../../uploads/WCGhkqJ9TFTKbUVAiE4XWmaxXPGhvXDr4yMg3VOo.jpeg\" alt=\"\" width=\"498\" height=\"468\" /></span></p>',1,10,1),(34,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Этот летчик прославился в ходе Курской битвы и получил звание Героя Советского Союза. Кто этот герой?</span></p>\r\n<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><img src=\"../../uploads/7K2p0jXDN6UugAVLUWY7sr8qeTs8IlBy06nPLIa8.jpeg\" alt=\"\" width=\"661\" height=\"464\" /></span></p>',1,10,3),(35,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">8 июня 1957 года в г. Белгороде был открыт памятник танкисту, освободившему наш родной город. Кто этот герой?</span></p>\r\n<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><img src=\"../../../uploads/qBc9mtzwST1PxmDt41CvQjpyZdqkk6I17a6nphRk.jpeg\" alt=\"\" width=\"582\" height=\"402\" /></span></p>',1,10,3),(36,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14.0pt;\">На фото изображен автор этих строк. Кто это?</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &laquo;.. И каждый дом и переулок,</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; И каждым камнем вся Москва </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Распознавала в этих гулах - </span></p>\r\n<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Орёл и Белгород - слова&raquo;.&nbsp;</span></p>\r\n<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><img src=\"../../uploads/1dn4QcfBukEL7Srx7wI73XSlUiBreCL1L9Tf5jRA.jpeg\" alt=\"\" width=\"413\" height=\"584\" /></span></p>',1,10,3),(37,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Какое оружие впервые было применено немцами в ходе Курской битвы?</span></p>',1,10,3),(38,'<p><span style=\"font-size: 14.0pt; font-family: \'Liberation Serif\',\'serif\'; mso-fareast-font-family: NSimSun; mso-bidi-font-family: Arial; mso-ansi-language: RU; mso-fareast-language: ZH-CN; mso-bidi-language: HI;\">Где и в честь какого события 27 января 1944 г. прозвучали 24 залпа артиллерийского салюта из 324 орудий?&nbsp;&nbsp;</span></p>',1,10,4),(39,'<p class=\"Standard\"><span style=\"font-size: 14.0pt;\">Несмотря на военное время, какое нововведение произошло в СССР в 1944 году?</span></p>',1,10,4),(40,'<p>При объезде действующих войск 29 февраля 1944 года был смертельно ранен командующий войсками 1-го Украинского фронта, генерал армии, память которого хранит улица Белгорода:</p>\r\n<p><img src=\"../../uploads/iYgkukyfoMiJaEfxW8yn0xWikfyH9XuDwrHNpLXU.jpeg\" alt=\"\" width=\"614\" height=\"232\" /></p>',1,10,4),(41,'<p class=\"Standard\"><span style=\"font-size: 14.0pt;\">Какой государственный символ СССР был утвержден в январе 1944 года на Пленуме ЦК ВКП?</span></p>',1,10,4),(42,'<p class=\"Standard\"><span style=\"font-size: 14.0pt;\">С какой страной летом 1944 года СССР<span style=\"mso-spacerun: yes;\">&nbsp;</span>установил<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;</span>дипломатические отношения?<span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>\r\n<p class=\"Standard\"><span style=\"font-size: 14.0pt;\"><span style=\"mso-spacerun: yes;\"><img src=\"../../uploads/X1F7gI8HcDokjfy5aQkcdnxRvT3lHoIsfNHB2aS8.jpeg\" alt=\"\" width=\"526\" height=\"353\" /></span></span></p>',1,10,4),(43,'<p>5 августа 1944 года в Моабитской тюрьме фашистами казнён татарский поэт и его соратники по антифашистскому подполью. После войны посмертно этому поэту присвоено звание героя Советсткого Союза, а цикл его&nbsp; стихов \"Моабитская тетрадь\" удостоин Ленинской премией. Назовите этого поэта. Отрывок из его произведения:</p>\r\n<p class=\"Standard\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">Они с детьми погнали матерей </span></p>\r\n<p class=\"Standard\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">И яму рыть заставили, а сами </span></p>\r\n<p class=\"Standard\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">Они стояли, кучка дикарей, </span></p>\r\n<p class=\"Standard\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">И хриплыми смеялись голосами. </span></p>\r\n<p class=\"Standard\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">У края бездны выстроили в ряд </span></p>\r\n<p><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">Бессильных женщин, худеньких ребят.</span><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif;\"><br /><!-- [if !supportLineBreakNewLine]--><img src=\"../../uploads/EqSgKBBGnvvEZq9VdVBRvZmiwvMjHYJOXveZGuBm.jpeg\" alt=\"\" width=\"230\" height=\"300\" /><br /><!--[endif]--></span></p>',1,10,4),(44,'<p>7 ноября 1944 года в Японии был казнён немецкий журналист, дипломат, а на самом деле советский разведчик, посмертно награждённый званием Героя Советского Союза. Его последними словами были \"Да здраствует Советский Союз, да здравствует Красная Армия!\"</p>\r\n<p><img src=\"../../uploads/EyAeNmBbPcApK1fJnT4gSrqhZh9hftEroDAZXnx8.jpeg\" alt=\"\" width=\"458\" height=\"633\" /></p>',1,10,4),(45,'<p>19 августа 1944 года советский лётчик, Гвардии полковник первым среди фронтовиков был удостоен третий раз звания Героя Советского Союза. За годы войны он совершил 650 вылетов, провёл 156 воздушных боёв, сбил 59 вражеских самолётов лично. Кто этот герой?</p>\r\n<p><img src=\"../../uploads/1lgOGqE3bqQ23Sz0vAPZA4wHJBwfMuYznbsJ2M12.jpeg\" alt=\"\" width=\"415\" height=\"429\" /></p>',1,10,4),(46,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: NSimSun; mso-ansi-language: RU; mso-fareast-language: ZH-CN; mso-bidi-language: HI;\">27 января 1945 года&nbsp; в результате успешного контрнаступления советские войска освободили самый известный в мире и самый страшный концентрационный лагерь. Это была настоящая фабрика смерти, располагавшаяся на территории Польши. Какое название носил лагерь?</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: NSimSun; mso-ansi-language: RU; mso-fareast-language: ZH-CN; mso-bidi-language: HI;\"><img src=\"../../uploads/BOO3cxeFFMwACukIzWmLsXauskkd2BDT2vKbNMaM.jpeg\" alt=\"\" width=\"682\" height=\"455\" /></span></p>',1,10,5),(47,'<p class=\"Standard\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; color: black; background: white; mso-bidi-font-weight: bold;\">С 4 по 11 февраля 1945 года в Ялте состоялась крупнейшая конференция руководителей СССР, Великобритании и США. На данной конференции решались вопросы, способствовавшие привести мир к Победе над Германией. Как называлась конференция?</span></p>\r\n<p><img src=\"../../uploads/E4QCMCK7gTy12qPWMeNsynfJosk861mDSayWZEQg.jpeg\" alt=\"\" width=\"669\" height=\"500\" /></p>',1,10,5),(48,'<p class=\"Standard\"><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\';\">16 апреля 1945 года началась <span class=\"StrongEmphasis\"><span style=\"color: black; background: white;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>крупнейшая финальная операция, главной задачей которой являлся захват столицы Германии. Завершилась данная операция 8 мая окончательной Победой СССР над Германией. Как называлась операция?</span></span></span></p>',1,10,5),(49,'<p><span class=\"StrongEmphasis\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">Кто из советских маршалов руководил Берлинской операцией?</span></span></p>',1,10,5),(50,'<p class=\"Standard\"><span class=\"StrongEmphasis\"><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; color: black; background: white;\">Этот символ советские войска всегда берегли и не допускали, чтобы он попал к врагу. Он же стал символом Победы 2 мая 1945 года. Что это был за символ?</span></span></p>',1,10,5),(51,'<p><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: NSimSun; mso-ansi-language: RU; mso-fareast-language: ZH-CN; mso-bidi-language: HI;\">2 мая 1945 года на здании штаб-квартиры германского верховного главнокомандования&nbsp; было водружено знамя Победы<span class=\"StrongEmphasis\"><span style=\"background: white;\">. Как называется здание?</span></span><br /><!-- [if !supportLineBreakNewLine]--><img src=\"../../uploads/ewswSUk27tPitiu4UfP8PSHkd7ATNF6RTG5El6eN.jpeg\" alt=\"\" width=\"687\" height=\"492\" /><br /><!--[endif]--></span></p>',1,10,5),(52,'<p><span class=\"StrongEmphasis\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">Имена трех солдат навсегда вписаны в историю Победы. Именно они водрузили знамя Победы на крыше Рейхстага 2 мая 1945 года. Как звали трех героев?</span></span></p>\r\n<p><span class=\"StrongEmphasis\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\"><img src=\"../../uploads/aL7WhL91rwPvs7qiRhZ5ChG0zpAQyRbt6RtVXPTn.jpeg\" alt=\"\" width=\"611\" height=\"412\" /></span></span></p>',1,10,5),(53,'<p class=\"Standard\"><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\';\">8 мая 1945 года в Берлине представителями германского главнокомандования был подписан документ, официально подтверждавший Победу СССР в Великой Отечественной войне против немецко-фашистских захватчиков. Как назывался этот документ?</span></p>',1,10,5),(54,'<p><span class=\"StrongEmphasis\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">Когда было водружено Знамя Победы над Рейхстагом в Берлине?</span></span><strong><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: NSimSun; mso-bidi-font-family: Arial; mso-ansi-language: RU; mso-fareast-language: ZH-CN; mso-bidi-language: HI;\"><br /><!-- [if !supportLineBreakNewLine]--><img src=\"../../uploads/xjplICagDfNHIseWtdpPgTbk8nMRpQygUr3oLFp8.jpeg\" alt=\"\" width=\"721\" height=\"479\" /><br /><!--[endif]--></span></strong></p>',1,10,5),(55,'<p><span class=\"StrongEmphasis\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\">Какой из этих отечественных танков стал легендой Второй Мировой войны?</span></span><strong><span style=\"font-size: 14.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: NSimSun; mso-bidi-font-family: Arial; mso-ansi-language: RU; mso-fareast-language: ZH-CN; mso-bidi-language: HI;\"><br /><!-- [if !supportLineBreakNewLine]--><br /><!--[endif]--></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"StrongEmphasis\"><span style=\"font-size: 14pt; font-family: \'Times New Roman\', serif; background: white;\"><img src=\"../../../uploads/Gg3Qu8tMa5vnouxmzrBmPcMKDtKKle6CAjcZXeUu.jpeg\" alt=\"\" width=\"795\" height=\"524\" /></span></span></p>',1,10,5),(56,'<p><span style=\"font-family: OpenSans; font-size: 14.08px; background-color: #ffffff;\">Добившись коренного перелома в ходе Великой Отечественной войны, разгромив врага под Сталинградом и Курском в 1944 году, советские вооружённые силы начали освобождение территории СССР и стран Европы от фашистских захватчиков. Форсирование какой реки ознаменовало это событие?</span></p>',1,10,4);
/*!40000 ALTER TABLE `questions` ENABLE KEYS */;
